import React from 'react'

import * as data from '../../static/data/navBar.json'

function NavBar() {
  return (
    <div>
        <h2 className='website-title'>Booking Website</h2>
        <div>
        <button>Login</button>
        <button>Register</button>
        </div>
        <div className=''>
            {
                data.map((item) => {
                <ul>
                    <li key={item.type}>
                        {item.type}
                    </li>
                </ul>
            })
            }
        </div>
        

    </div>
    
  )
}

export default NavBar
